INSERT INTO `hotel` (`nombreHotel`, `codigoHotel`, `descripcionHotel`, `estrellas`) VALUES
('Senator Granada Spa', '001', 'El elegante Senator Granada Spa se encuentra junto al Palacio de Congresos y el centro de Granada, a 250 metros del centro histórico de la Ciudad. Los dormitorios son modernos, están insonorizados e incluyen TV y lámparas de lectura flexibles. Se ofrece conexión Wi-Fi básica de forma gratuita y conexión Wi-Fi de alta velocidad por un suplemento. Los huéspedes reciben una sesión gratuita de SPA. Ofrecemos acceso gratuito al gimnasio y a la zona de aguas del SPA. Se facilita aparcamiento privado en el hotel por un suplemento, sujeto a disponibilidad. Estamos a 2 km de la Alhambra.', 4),
('VITA San Anton', '002', 'El VITA San Antón está situado frente al centro de convenciones de Granada y ofrece vistas al río Genil, una piscina al aire libre, conexión Wi-Fi gratuita y excelentes vistas a la Alhambra y a Sierra Nevada. Las habitaciones del San Antón cuentan con TV vía satélite con Canal+, aire acondicionado, hilo musical y baño con secador de pelo. Además, el VITA San Antón alberga una cafetería, un bar en la terraza de la azotea y 2 restaurantes a la carta con vistas panorámicas. Durante el verano, los huéspedes podrán disfrutar de una barbacoa en la terraza. Los huéspedes encontrarán aparcamiento al aire libre junto al VITA San Antón. El personal de la recepción, disponible las 24 horas, ofrece un servicio de alquiler de coches e información turística.', 4),
('MA NAzaríes Business & Spa', '003', 'Servicio de lujo con todas las comodidades para que tu estancia sea de 5 estrellas. El Nazaríes Business & Spa se encuentra a pocos metros de la calle Recogidas y a 500 metros del Palacio de Congresos. Cuenta con un spa y habitaciones con TV de pantalla plana. Las habitaciones del Nazaríes son amplias y disponen de caja fuerte, minibar y baño privado con albornoz y zapatillas. El hotel cuenta con conexión Wi-Fi gratuita en las zonas comunes y alberga un centro de negocios pequeño equipado con ordenadores e impresora. También hay 10 salas de reuniones de alquiler. El Nazaríes sirve un desayuno bufé variado y el restaurante Las Gacelas ofrece platos andaluces tradicionales. También hay un piano bar y se ofrece servicio de habitaciones las 24 horas.', 5),
('Maciá Monasterio de los Basilios', '004', 'Este monasterio de principios del siglo XVII se encuentra junto al río Genil, a sólo 300 metros del centro de convenciones de Granada. Hay conexión inalámbrica a internet gratuita y TV de pantalla plana en todas las habitaciones. El Maciá Monasterio de los Basilios fue construido sobre un antiguo templo musulmán. El edificio data del 1616 y conserva muchos detalles originales. El Monasterio de los Basilios está ubicado a sólo 10 minutos a pie de la catedral de Granada y del centro histórico de la ciudad. Los autobuses que conectan con el palacio de la Alhambra tienen parada frente al hotel y la parada de los autobuses que unen con el aeropuerto también está cerca. El restaurante del hotel está en un altillo y sirve comida mediterránea. El hotel también ofrece servicio de alquiler de coches y un mostrador de información turística. Todas las habitaciones cuentan con aire acondicionado, calefacción y con un cuarto de baño con artículos de tocador.', 3);

